import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';


const CreateUsuario = () => {
    const endpoint = 'http://127.0.0.1:8000/api/Usuario';

    const [Name, setName] = useState("");
    const [Email, setEmail] = useState("");
    const [Password, setPassword] = useState("");
    const [Direccion, setDireccion] = useState("");
    const [Telefono, setTelefono] = useState("");
    const [FechaNacimiento, setFechaNacimiento] = useState("");
    const navigate = useNavigate("");

    const store = async (e) => {
        e.preventDefault();
        await fetch("",
            {
                method: "POST",
                body: JSON.stringify({
                    Name: Name,
                    Email: Email,
                    Password: Password,
                    Direccion: Direccion,
                    Telefono: Telefono,
                    FechaNacimiento: FechaNacimiento,
                })
            }).then(response => response.json());
        navigate("/");
    }

    return (
        <div className="card" >
            <div className="card-body">
                <h5 className="card-title">Lista de Usuarios</h5>

                <form onSubmit={store} className='text-start'>

                    <div className="row mb-3">

                        <div className='col-6'>
                            <label for="Name" class="form-label">Nombre completo: </label>
                            <input type="text" class="form-control" id="Name" placeholder="Nombre Completo" value={Name} onChange={(e) => setName(e.target.value)} />
                        </div>

                        <div className='col-6'>
                            <label for="Email" class="form-label">Correo electrónico: </label>
                            <input type="email" class="form-control" id="Email" placeholder="Correo electrónico" value={Email} onChange={(e) => setEmail(e.target.value)} />
                        </div>

                    </div>

                    <div className="row mb-3">

                        <div className='col-6'>
                            <label for="Password" class="form-label">Contraseña: </label>
                            <input type="password" class="form-control" id="Password" placeholder="Contraseña" value={Password} onChange={(e) => setPassword(e.target.value)} />
                        </div>

                        <div className='col-6'>
                            <label for="Direccion" class="form-label">Dirección: </label>
                            <input type="text" class="form-control" id="Direccion" placeholder="Dirección" value={Direccion} onChange={(e) => setDireccion(e.target.value)} />
                        </div>

                    </div>

                    <div className="row mb-3">

                        <div className='col-6'>
                        <label for="Telefono" class="form-label">Teléfono: </label>
                        <input type="text" class="form-control" id="Telefono" placeholder="Teléfono" value={Telefono} onChange={(e) => setTelefono(e.target.value)} />
                        </div>

                        <div className='col-6'>
                            <label for="FechaNacimiento" class="form-label">Fecha de Nacimiento: </label>
                        <input type="date" class="form-control" id="FechaNacimiento" placeholder="Fecha de Nacimiento" value={FechaNacimiento} onChange={(e) => setFechaNacimiento(e.target.value)} />
                        </div>

                    </div>


                    <div className='d-flex justify-content-around'>
                        <Link to="/" class="btn btn-label-warning">Regresar</Link>
                        <button type="button" class="btn btn-label-primary">Registrar</button>
                    </div>
                </form>
            </div>
        </div>
    )
}

export default CreateUsuario;
